import React, { useEffect } from "react";
import Proposition from "../../component/Proposition/Proposition";
import axios from "axios";
import "./Main.scss";
import Carousel from "../../component/Carusel/Carousel";

const Main: React.FC = () => {

  useEffect(() => {
    fetch("https://orthosie-old-english-translator-v1.p.rapidapi.com/oldenglish.json?text=A%20hearty%20meal%2C%20a%20happy%20laughter%20is%20all%20we%20need.")
    .then(response => {
      response.json();
    })
    .then(response => {
      console.log(response);
    })
    .catch(err => {
      console.error(err);
    });
  }, []);

  return (
    <div className="page">
      <Carousel />
      <Proposition />
    </div>
  );
};

export default Main;
